description:
Reeds, The (2009)  

Verenigd Koninkrijk
Horror / Thriller
90 minuten

geregisseerd door Nick Cohen
met Scarlett Alice Johnson, Geoff Bell en Emma Catherwood

Een groep jonge Londenaren heeft een feestje op een boot. Maar dan raken ze verdwaald op de wateren van Norfolk Broads. Dit is echter niet hun grootste probleem; ze worden de slachtoffers van een angstaanjagend geheim, dat verborgen zit tussen het riet.

